import React from 'react';
import Post from './Components/Post';
import Header from './Components/Header';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import './App.css';

function App() {
  return (
    <Router>
      <Routes>
        <Route index Component={
          <main>
            <Header/>
            <Post/>
            <Post/>
            <Post/>
          </main>
        }/>
      </Routes>
    </Router>
  );
}

export default App;
